import React from 'react';
import EmailCard from './EmailCard';
import Analytics from './Analytics';

export default function Dashboard({emails, onSaveDraft}){
  return (
    <div className="dashboard">
      <Analytics emails={emails}/>
      <div className="email-list">
        {emails.length === 0 && <div>No emails yet. Use 'Fetch Emails' or run seed.</div>}
        {emails.map(e => <EmailCard key={e.id} email={e} onSave={(d)=>onSaveDraft(e.id, d)}/>)}
      </div>
    </div>
  )
}
